// /home/parcoadmin/parco_fastapi/app/src/components/ZoneBuilder.js
import React, { useState, useEffect, useRef } from "react";
import L from "leaflet";
import "leaflet-draw";
import "leaflet/dist/leaflet.css";
import "leaflet-draw/dist/leaflet.draw.css";
import MapZoneBuilder from "./MapZoneBuilder";
import "./ZoneBuilder.css";

const ZoneBuilder = () => {
    const [maps, setMaps] = useState([]);
    const [zones, setZones] = useState([]);
    const [parentZones, setParentZones] = useState([]);
    const [selectedMapId, setSelectedMapId] = useState(null);
    const [selectedZoneType, setSelectedZoneType] = useState(null);
    const [selectedParentZone, setSelectedParentZone] = useState(null);
    const [zoneName, setZoneName] = useState("");
    const [vertices, setVertices] = useState([]); 
    const [useLeaflet, setUseLeaflet] = useState(false);
    const drawnItems = useRef(new L.FeatureGroup());

    // ‚úÖ Fetch maps, zone types, and parent zones
    useEffect(() => {
        fetch("/zonebuilder/get_maps")
            .then(response => response.json())
            .then(data => setMaps(data.maps))
            .catch(error => console.error("Error fetching maps:", error));

        fetch("/zonebuilder/get_zone_types")
            .then(response => response.json())
            .then(data => setZones(data))
            .catch(error => console.error("Error fetching zones:", error));

        fetch("/zonebuilder/get_parent_zones")
            .then(response => response.json())
            .then(data => setParentZones(data.zones))
            .catch(error => console.error("Error fetching parent zones:", error));
    }, []);

    // ‚úÖ Save Zone with Correct X, Y, Z Coordinates (in feet)
    const saveZone = async () => {
        let zoneVertices = [];

        // üéØ Handle Leaflet Vertices (if enabled)
        if (useLeaflet) {
            drawnItems.current.eachLayer(layer => {
                if (layer instanceof L.Polygon) {
                    layer.getLatLngs()[0].forEach((point, index) => {
                        zoneVertices.push({
                            n_x: point.lng,  // Correctly mapped to X in feet
                            n_y: point.lat,  // Correctly mapped to Y in feet
                            n_z: 0,          // Default Z value
                            n_ord: index + 1 // Order of vertex
                        });
                    });
                }
            });
        } else {
            // üéØ Handle Canvas Vertices (ensure they are collected)
            zoneVertices = vertices.map((v, index) => ({
                n_x: v.x,  // Already in feet
                n_y: v.y,  // Already in feet
                n_z: 0,    // Default Z value
                n_ord: index + 1
            }));
        }

        const zoneData = {
            zone_name: zoneName,
            map_id: selectedMapId,
            zone_level: selectedZoneType,
            parent_zone_id: selectedParentZone,
            vertices: zoneVertices,
        };

        try {
            const response = await fetch("/zonebuilder/create_zone", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(zoneData),
            });

            const result = await response.json();
            if (response.ok) {
                alert(`‚úÖ Zone '${zoneName}' created successfully!`);
            } else {
                alert(`‚ùå Error: ${result.detail}`);
            }
        } catch (error) {
            console.error("Error creating zone:", error);
            alert("‚ö†Ô∏è Failed to create zone");
        }
    };

    return (
        <div>
            <h2>Zone Builder</h2>

            <label>Zone Type:</label>
            <select onChange={(e) => setSelectedZoneType(e.target.value)}>
                <option value="">Select Zone Type</option>
                {zones.map(zone => (
                    <option key={zone.zone_level} value={zone.zone_level}>{zone.zone_name}</option>
                ))}
            </select>

            <label>Map:</label>
            <select onChange={(e) => setSelectedMapId(e.target.value)}>
                <option value="">Select Map</option>
                {maps.map(map => (
                    <option key={map.map_id} value={map.map_id}>{map.name}</option>
                ))}
            </select>

            <label>Parent Zone:</label>
            <select onChange={(e) => setSelectedParentZone(e.target.value)}>
                <option value="">(None - Parent Zone)</option>
                {parentZones.map(zone => (
                    <option key={zone.zone_id} value={zone.zone_id}>{zone.name}</option>
                ))}
            </select>

            <label>Zone Name:</label>
            <input type="text" value={zoneName} onChange={(e) => setZoneName(e.target.value)} placeholder="Enter Zone Name" />

            <label>Render with Leaflet:</label>
            <input type="checkbox" checked={useLeaflet} onChange={(e) => setUseLeaflet(e.target.checked)} />

            {useLeaflet ? (
                <div id="zoneMap" style={{ height: "500px", width: "100%" }}>
                    <MapZoneBuilder zoneId={selectedMapId} onDrawComplete={setVertices} useLeaflet={true} />
                </div>
            ) : (
                <MapZoneBuilder zoneId={selectedMapId} onDrawComplete={setVertices} useLeaflet={false} />
            )}

            <button onClick={saveZone}>Save Zone</button>
        </div>
    );
};

export default ZoneBuilder;
